<div id="div62"style="color:#ffffff">
<p>IEEE-TSEC Computer Society offers myriad benefits for individuals to develop a cumulative interest in the field of computing technology. It endeavors to advance the practical and technical application of computing and information technology. This society engages in conducting several beneficial workshops and seminars for the students, to enable them to get a firsthand experience of the wonders of computing technology. 
			<p>The Computer Society makes a constant effort to become bigger and better so that the members can have tremendous opportunities for participation in fields of computer and information technology.
			</div>
			<div id="div42" style="color:#ffffff">
			<p>IEEE-TSEC Industry Applications Society (IAS) believes in building a Complete Engineer who is updated with upcoming inventions in the field of technology and scientific development and at the same time has a firsthand experience in learning about robotics and electronics. This society endeavors to promote the advancement of the theory and practice of electrical and electronic engineering in the development, design, manufacture and application of electrical systems. 
			<p>IEEE-TSEC IAS holds an Industrial Forum once during the course of the entire year to introduce its members to the workings of the industrial world. IEEE-TSEC IAS also has a Distinguished Lecturer program, where a noted dignitary from IEEE comes to college to present a seminar or a conference on current technical innovations.
			</div>
			<div id="div72" style="color:#ffffff">
			<p>IEEE-TSEC Robotics and Automation Society promotes the advancement of science, technology and applications of theory and practice of robotics and automation engineering. This society maintains the highest standard of professionalism and technical competency. IEEE-TSEC RAS strives to keep the members abreast with the latest research and development done in the field of robotics and automation science and engineering.
			</div>
			<div id="div52" style="color:#ffffff">
			<p>IEEE-TSEC Engineering in Medicine and Biology Society (EMBS) is one of the oldest biomedical societies in Mumbai. It benefits its members by advancing in the field of medicine and biology through the application of engineering sciences and technology, promoting the professions of bioengineering. This society strives to regenerate interest and knowledge about the novel world of biotechnology and has the potential to achieve greatness in this field. One of the highlights of IEEE-TSEC EMBS is its annual hospital or research centre visit – HELIX. It also publishes its own newsletter BIOBYTES.
			</div>
			<div id="ieeei" style="color:#ffffff">
			<p>IEEE-TSEC Student Activities and Conferences (ISAAC) focuses on inquisitiveness, perseverance and penchant for hard work through fusion of knowledge, experimentation and analysis. It works at encouraging the creativity of the future engineers. Being the annual inter-collegiate technical festival of IEEE-TSEC, ISAAC continues bringing out the best in students through seminars, workshops and contests for over 14 years. ISAAC proudly holds the title of being the largest technical festival under Mumbai University. It is an arena, a platform for young intellectual minds to learn and imbibe technical knowledge, battle in contests honing their creative and technical skills, and win laurels commending their perseverance.
			</div>
</div>
<div id="div9">
<ul id="slide1">
