</div>
<div id="accordion">
	<h3>MOSAIC</h3>
	<div>MOSAIC is an intra-collegiate festival held during the month of February. It consists of seminars and workshops held by professionals from leading companies and technical institutes. This festival aims to expand the technical knowledge of students participating in the festival, by actively engaging them in the workshops and seminars.<p></div>
	<h3>IGNITION</h3>
	<div>IGNITION is an intra-collegiate festival held during the month of August. IGNITION usually consists of workshops and fun events, which test the managerial and organizational skills of the members and the volunteers.</div>
</div>
<div id="accordion1">
	<h3>TECHTRIX</h3>
	<div>TECHTRIX is an intra- collegiate even semester festival conducted during the month of February.<p></div>
	<h3>BLITZ</h3>
	<div>Blitz is an intra-collegiate festival held during the month of August. It usually consists of a robotics workshop, which is conducted by the CONATUS team of our college, and a fun event.</div>
</div>
<div id="accordion2">
	<h3>NOVA</h3>
	<div>NOVA is an inter-collegiate festival held during the month of February.<p></div>
	<h3>TECHNO</h3>
	<div>TECHNO is an intra-collegiate festival held during the month of August.</div>
</div>
<div id="accordion3">
	<h3>CEREBRATION</h3>
	<div>CEREBRATION is an annual inter collegiate festival held at the start of the academic year, in the even semester. It includes seminars and workshops which are taken up by highly qualified professionals from renowned firms/hospitals/institutes. It also conducts a few contests as a part of this event.<p></div>
	<h3>HELIX</h3>
	<div>It is an annual hospital or research centre visit. It is one of the highlights of IEEE-TSEC EMBS. It gives students an insight into the new advancements in the biotechnical and biomedical world. Students also get a chance of interacting with the experts of the respective field.</div>
	<h3>PULSE</h3>
	<div>The odd semester event of IEEE-TSEC EMBS is 'PULSE'. The volunteers organize the festival which comprises of a seminar and a fun-event.</div>
	<h3>BIOBYTES</h3>
	<div>Biobytes is the newsletter published by the IEEE-TSEC EMBS. The newsletter keeps the students abreast with the latest research and development done in the world of bio-engineering.</div>
</div>
<div id="accordion4">
	<h3>ISAAC</h3>
	<div>IEEE-TSEC Student Activities and Conferences (ISAAC) focuses on inquisitiveness, perseverance and penchant for hard work through fusion of knowledge, experimentation and analysis. It works at encouraging the creativity of the future engineers. Being the annual inter-collegiate technical festival of IEEE-TSEC, ISAAC continues bringing out the best in students through seminars, workshops and contests for over 14 years. ISAAC proudly holds the title of being the largest technical festival under Mumbai University. It is an arena, a platform for young intellectual minds to learn and imbibe technical knowledge, battle in contests honing their creative and technical skills, and win laurels commending their perseverance.<p></div>
	<h3>INDUSTRIAL VISIT</h3>
	<div>Every year, IEEE-TSEC organizes industrial visits to prominent industrial establishments around India, to give students an in-depth view and experience of the workings of the industrial world.</div>
	<h3>NEWTON</h3>
	<div>Newton is IEEE-TSEC’s annual even semester fun festival. It is conducted for the benefit of its members in order to introduce them to IEEE-TSEC.</div>
</div>
